(6, '212fea9c-8b13-4a58-9b0e-b15dbd7e20ae', '791d2237-adf5-4d96-b754-357ab7c2a9bf', '', '【求职必读】留学生如何准备背调？', '通常在HR发放校招Offer之后，会通知候选人进行背景调查，在获得候选人准许后，由HR或第三方企业对候选人进行背景资料以及证明材料的核实，对于回国就业的留学生来说，企业背景调查的内容主要包括学历验证（学历学位、荣誉证书）；实习证明、项目成果；社会基础信息调查（社会征信、工商信息、犯罪记录）等。', '求职必读', '', '我可以拒绝背景调查吗？\n理论上来讲是可以的，但是实际情况有可能会因为候选人拒绝了企业背景调查，导致HR认为材料作假，从而直接失去这次机会。\n企业的背景调查通常不会用于不当用途，也不会侵犯候选人的隐私，所以大可不必担心，选择接受，然后继续走流程即可。但同时也要谨慎企业不合规的情况，注意保护自己的权益。\n \n背景调查需要我提前准备材料吗？\n需要！尤其是现在留学生回国就业，会面临诸如学校不回邮件，学历认证不好办等等状况。所以一定要在回国之前在学校把相关资料都拿到手，其中包括但不限于：\n留学生回国学历认证需要材料\n文凭证书\n护照/通行证/身份证\n居留卡/签证/签注\n证件照片\n授权声明\n其他材料\n技能证书\n相关国家语言等级证明\n专业资格考试成绩单\n实习证明/项目经历证明\n其中需要注意的是，由于留学生回国学历认证需要一定的时间期限，为了不影响Offer，在拿到文凭证书的时候，就可以开始着手在教育部留学服务中心网上服务大厅办理。如果确实因为不能在入职前取得相应学历认证材料，那么请第一时间联系HR，并提供相关材料。\n \n应该怎么应对企业背景调查？\n首先，背景调查在正常情况下只是一个辅助的流程，为了验证候选人材料的真实性、可靠性，从而为企业规避风险。其次，求职者应放平心态，以积极的态度来配合企业进行背景调查，不出意外还是很容易通过的~\n不过各位候选人还是要注意：千万不要简历造假或过度注水，在回国前尽量准备好所有材料，提前和实习公司、项目负责人打好招呼（可能会对其进行电话或邮件询问）。\n最后，祝大家都能拿到理想Offer，通过企业背景调查，进入梦中情厂！', '1', 'http://localhost:3303/static/upload/1683956571846.png', '2023-05-13 13:41:21', '2023-5-13 13:48:08'),
(7, '278e8086-2749-4ecf-85a6-e87849890282', '791d2237-adf5-4d96-b754-357ab7c2a9bf', '', '【海归必读】零经验？不慌！', '对于部分应届生，读书课程安排紧张，只是应付学业就已经非常吃力，再加上其它各种因素，根本没有时间、也没有机会实习。缺少实习经验，求职遇到最直接、最“致命”的影响是简历内容不充实，只能写一些假大空的套话。对于向来“老奸巨猾”的招聘者BOSS来说，你就是个还没出新手村任务的玩家！在打怪刷级之日的你使用百八十次投简历的招数，但事实上却几乎收不到一个回复和面试邀请。\n所以本文将详解没有实习/工作经验的应届生', '求职必读', '', '什么可以替代工作经验\n首先要理解的是，如果有一份实习经验或者项目经历，那绝对是整个简历中最亮眼的部分。\n写一份简历要包含5大必有模块：个人信息、教育背景、工作/实习经历、校园与社会实践、技能及奖项。\n而工作、实习经历是简历的重中之重，占了很大的篇幅。在没有实习经历的情况下，我们需要扩充其它部分的内容来丰富简历，来代替缺失的内容。\n常用的方法是将校园与社会实践、项目经历等展开写，咱们具体用案例来给大家讲解。\n \n定制化简历：即使0经验也能打动HR\n在写简历前，先确定、分析、搞懂自己要投递的岗位！大多数企业在招人时，一定有明确的岗位空缺和特定的人才要求：\n“我需要招一个xxx样的人，来做xx的工作”。\n之所以招聘者对你的投递感兴趣，一定是求职者简历里体现的某一个或某些东西契合了这份工作的要求。\n作为0经验的小白，可以围绕心仪的公司，根据岗位描述逐条定制自己的简历来契合招聘者的要求。 用入门的岗位JD举例：咱们来看这个【社群运营】的岗位\n\n让我们来根据岗位描述分析一波！\n第二点的意思是将看似无规律无章法的运营工作梳理成有条理可循的规范，方便之后再次开展同类工作，需要强的归纳总结能力和文笔能力。\n第三点的意思是需要求职者围绕数据统计分析，由于是运营岗而不是专业的数据分析师岗，那么数据分析的工作通常熟练使用Excel的小伙伴就能搞定了。\n第四点主要根据社群运营进行展开，沟通能力&文案能力，希望求职者可以善于跟用户聊天同时书写销售文案。\n第五点则要求求职者创意性强，有好的想法和玩法，另外文案能力也是活动成败的关键。\n \n \n用STAR法则来写每句话\n在这里要先插入科普一个知识，那就是STAR法则。\nSTAR法则就是是情境(situation)、任务(task)、行动(action)、结果(result)四项的缩写：在什么情况下、任务是什么、做了什么事情、获得了什么结果。\n我们试着使用STAR法则，针对前边的例子写几点校园经历，试着满足BOSS对求职者的能力要求\n1.归纳总结能力强。担任学生会xx部xx职位期间，曾总结并起草了数份xx部日常工作规范，受到了部员及部长的一致认可，至今仍被当做标准使用。\n2.数据分析能力较好。在xx课group work中负责处理数据，使用excel整理了50000+数据，使用数据透视表将数据透视并作图，该部分为整个报告的亮点。\n3.策划能力极强，脑洞大。参加xx社团期间曾成功组织xx活动，提出活动创意，主导活动筹备和现场管控。该活动吸引300+师生参加，收获大量好评。\n4.内容创作能力佳。在校期间自己创立了公众号，独立负责公众号的文案创作与运营，共发布20+篇文章，累计收获20000+阅读量。抖音玩的特别溜，经常拍出一些爆款视频，目前抖音号有2w+粉丝，累计收获点赞量达20W+。上述几点校园经历已经满足甚至超出招聘要求了\n其实不止是校园经历，生活中的一些其它经历也一样可以被发掘成为你简历中的闪光点。\n爱打游戏：在投“游戏运营策划岗位”时可以写，多年游戏经验，悉知市面上的各种游戏玩法和特点，对一些游戏有自己独到的见解，了解游戏玩家的想法，具有策划剧情与玩法的能力。\n读书时的兼职：可以写，自己有独立解决问题的能力，还在上学时通过超过旁人的努力，积累了人生的第一桶金和当地丰富的人脉资源，更有觉悟应对辛苦的工作。等等等等…\n \n缺少实习、工作经历在求职时确实会受到影响，但对于应届生来说，也未必是毁灭性的。当你能够熟练分析岗位描述里招聘者的真实需求，又能够很好的根据自身经历找到契合要求的那个点时，0经验的简历也一样可以打动招聘者，得到招聘者们的青睐噢~！\n以上是本期的分享，希望能够给各位带来帮助！\n ', '1', 'http://localhost:3303/static/upload/1683956687818.png', '2023-05-13 13:47:24', ''),
(8, '80c1a4fc-d01d-4746-8cbb-a21f387970ea', '791d2237-adf5-4d96-b754-357ab7c2a9bf', '', '【海归必读】面试一般需要多久？', '一般情况下，一次面试时间在30min左右，如果聊得比较深入，可能会拉长到一个小时左右，速度如果快一点，也基本上有20min。除此之外，建议答主，如果有经历的话，还可以再关注下自己的面试节奏哦。比如如何在30min的面试中，尽可能地向面试官展势自己具备进入公司的能力？面试本身是一个展示自己的过程，掌握好面试节奏，效果才会更好。', '干货文章', '', '这里有几条建议可以参考下：\n\n大块时间，都要用于展示自己的硬素质和岗位要求的技能，以及和面试官互动\n\n比如面试的岗位是新媒体运营，那么就要详细讲述的就是自己做了一个个人公众号，具体是怎么做的：做了哪些设置、原因是什么、目标是什么、尝试是什么，以及数据反馈和思考是什么……等等这些都是这个岗位所要求的硬技能。另外，在这个过程还需要和面试官去互动，他可能会问数据是怎样获得的、调整了哪些公众号页面的结构、还做出了哪些其他的尝试……\n\n关于硬素质，需要找到最能够展势自己可以胜任面试岗位要求的经验或者项目\n\n关于软素质，需要贯穿面试整个过程，指的是对工作的思考、对职业发展的思考\n\n \n\n小块时间，用于面试官向你的提问和你向面试官的提问\n\n这一部分比较好理解，在面试过程中可能会被问到比较难回答的问题和更多用于展现个人思考方向的问题。如果面试官问的问题方向和面试岗位没有太大的联系，就需要主动去转移方向\n\n举个栗子： 如果面试的岗位是新媒体运营，但是你之前是做销售的。面试官在问你之前的工作经验，你就需要比较精炼地描述一下你做销售时候的情况，然后再引导到和面试岗位有关的项目经验，比如做了关于个人公众号的尝试，然后主要来聊这一块你是怎么做的，而不是把大块的时间去用来说明自己做销售时候的业绩有多好……这样会浪费面试时间，消磨面试官的耐心。\n\n \n\n总结一下\n\n虽然我们不面试者，但是我们完全可以去尝试把握住面试话题的倾向性。面试官一天下来肯定不止面试一个人，所以他问的问题肯定不会针对每个人的自身优势去展开，或者他问的问题也不一定正确有用。我们要做的，就是引导面试官去聊自己相关能力方面的东西——具体的精力、项目以及案例。\n\n希望对你能有帮助！祝愿每个小伙伴都能拿到满意的OFFER！', '1', 'http://localhost:3303/static/upload/1683956956014.png', '2023-05-13 13:49:36', '2023-5-14 18:30:25'),
