INSERT INTO `pos` (`id`, `position_id`, `position_name`, `salary`, `cityName`, `pos_region`, `experiences`, `degrees`, `position_tag`, `welfare_tag`, `company_id`, `hr_id`, `position_desc`, `pos_addTime`, `updateTime`, `position_state`, `position_type1`, `position_type2`, `job_type`) VALUES
