(12, '07991258-ef1c-4b9d-87ab-8889fd4977a3', 'ef6c20b9-a368-43e7-ac3e-671a3c34cd74', '上海朗裕信息科技有限公司郑州管城分公司', '营销数据服务', '系统工程师', '销售部', '2023-05', '2023-06', '1、从事对日开发1年以上\n2、熟练掌握JAVA开发，熟悉spring MVC，spring Boot等主流框架\n3、可以独立看懂日文式样书\n4、良好的编码习惯、可以适应对日开发流程要求\n5、日语三级及以上\n6、有良好的团队合作精神，责任心强', '', '[\"Css\",\"Javascript\",\"Typescript\"]', '2023-05-07 15:23:19', '2023-05-07 15:23:19');
