(8, 'c419e7e7-1468-49d0-ad7f-8d31d9816e4c', '李四', 0, '0', '硕士', '21k-26k', '', '离职', '15335589151', 'x709500@163.com', '', '硬件项目经理', '', '', '电子商务', 'https://img.bosszhipin.com/boss/avatar/avatar_15.png', 0, 0, '2023-04-27 11:49:00.214199', '北大', '2023-05', '2023-05', '1. 流利的英语口语沟通能力\n2. 熟练掌握PHP常规开发技能, 精通Laravel，三年及以上的PHP开发经验\n3. 熟练使用主流数据库，如Mysql, SqlServer, MongoDB等\n4. 三年及以上的前端开发经验，熟练使用Vue3, 有其他前端框架使用经验更佳，如: React, Angular\n5. 懂HTTP，WebSocket等相关技术常识\n6. 熟练使用git\n7. 有业务分', '全日制', '1. 流利的英语口语沟通能力\n2. 熟练掌握PHP常规开发技能, 精通Laravel，三年及以上的PHP开发经验\n3. 熟练使用主流数据库，如Mysql, SqlServer, MongoDB等\n4. 三年及以上的前端开发经验，熟练使用Vue3, 有其他前端框架使用经验更佳，如: React, Angular\n5. 懂HTTP，WebSocket等相关技术常识\n6. 熟练使用git\n7. 有业务分', '浙江-丽水', '营销数据服务', '全职', '1'),
