(10, '543907cb-0c79-4810-84ee-5a4ffdbce807', '我是小薛', 0, '1', '硕士', '16k-29k', '2023-03', '离职', '18812766666', 'x709500@126.com', '', '前端开发工程师', '', '', '计算机信息管理', 'http://localhost:3303/static/upload/1683171527115.jpeg', 0, 0, '2023-04-27 12:52:22.969562', '清华大学', '2023-05', '2023-05', '1.精通DIV+CSS网页框架布局的HTML代码编写，熟悉W3C标准；\n2.使用HTML5/CSS3熟练地进行页面开发；\n3.掌握Vue前端开发技术\n4.熟悉JavaScript、Ajax、ExtJS等各种Web前端开发技术，具备一定的跨浏览器开发经验；\n5.熟练掌握photoshop技能者优先', '全日制', 'H5/Web前端开发工程师（实习生）\n职位描述：\n1. 根据设计要求，完成公司自有项目的Web前段和H5App、小程序开发工作\n2. 主流浏览器及移动设备的兼容性调试\n3. 使用主流前端框架开发项目\n4. 参与公司产品用户界面的改进和创新\n5. 完成上级布置的其他工作任务\n资格要求：\n1、大专及以上学历，计算机、通信及相关专业；\n2、精通HTML/XHTML、CSS等网页制作技术，熟悉页面架构和布', '天津-天津', '采矿业', '全职', '1'),
(11, 'ef6c20b9-a368-43e7-ac3e-671a3c34cd74', '王五', 0, '1', '本科', '2k-5k', '2023-03', '在职', '18812756547', 'x709500@yeah.com', '', '通信项目专员', '', '', '软件工程', 'https://img.bosszhipin.com/boss/avatar/avatar_15.png', 0, 0, '2023-05-07 15:20:55.999720', '上海交通大学', '2023-05', '2024-07', '1， 熟练搭建Linux服务器生产环境；\n2，熟练掌握MySql等数据库设计和优化表、优化sql语句；\n3，熟练掌握PHP开发语言\n4，熟练使用Yii2或TP,CI,Laravel框架开发项目,3年以上开发经验\n5，熟练使用SVN、GIT、PhpStorm等开发工具\n6，熟悉HTML5+CSS3+JS编程，各种前端调试工具\n7，熟练使用各种调试、分析工具，能独立分析、解决和归纳问题；', '非全日制', '工作：Web和微信端小程序开发，使用vue、elementUI和eCharts，前后端分离（后端JAVA）。\n不出差，不外派，就在郑州二七区做开发。\n实习工资（阶梯式）：前3月根据能力1-2k，然后每3个月加一次工资。', '黑龙江-牡丹江', '医疗健康', '校招', '1'),
